#QOTD What are some of the strangest things you've used for a bookmark?⁣
⁣
I love collecting and making bookmarks and you might think I wouldn't have a problem when I have to mark my place in a book. Wrong.⁣
⁣
There's never a conventional bookmark in reach when I need one and I usually have to make do with what's handy.⁣
(I hate dog-earing pages so that's not an option. I know, it isn't a cardinal sin, but I just can't get myself to do it 🤷‍♀)⁣
⁣
Some of the best alternatives I've used include:⁣
⁣
-Chocolate wrappers! 🍫⁣
I almost never leave home without a book and a bar of chocolate, which makes wrappers the most convenient option.⁣
Also the most common and accepted one, right?⁣
⁣
-Combs, hairpins, hair ties⁣
Ironically I never find any of these when I need to tame my hair 😶 ⁣
⁣
-Random piece of paper⁣
Usually something important which I'll later spend hours looking for 🙂⁣
⁣
-Baby nephew's socks⁣
They're all over my place and never in pairs. The kid can't wear them that way so I'm just putting it to good use 🥰⁣
⁣
-Money⁣
No, not just paper currency. I use coins as well.⁣
Ever walked around some place with a book in your hand only for coins to spill out of it like you've won the jackpot on a slot machine? I have! 🙃⁣
⁣
📚❤⁣
