⠀
Di solito sul blog il venerdì cade la deliziosa rubrica delle Twins Books Lovers dal titolo 5 cose che.
⠀
La quintina di oggi riguarda i 5 titoli più belli letti finora nell'arco del 2020.
⠀
Devo ammettere che quest'anno pochissimi libri hanno catturato la mia completa attenzione perchè per un motivo o per un altro, gli ho riconosciuto dei difetti.
⠀
Nella mia top five, comunque, ci sono:
1) Falce edito dalla Oscar Vault che mi ha completamente rapito. L'impostazione distopica, il messaggio sull'ineluttabilità della morte e i personaggi mi hanno incantata. Leggevo e mi innamoravo.
⠀
2) Stepsister pubblicato dalla divisione Ragazzi della Mondadori che ha preso i retelling letti negli ultimi due anni e ne ha fatto carta straccia. Potente e scorrevole, l'autrice ha donato una prospettiva nuova alla favola più antica e più bella di sempre, Cenerentola.
⠀
3) Heartstopper di Alice Oseman è una storia così pura che non ho potuto fare a meno di leggerla due volte, in inglese e in italiano. Le tavole, abbozzate con la matita, sono espressive, dolci, tenere. Ho avuto i brividi tutto il tempo. Poi, diciamolo, quel finale spezza i cuori.
⠀
4) Un assassino alle porte mi ha mentalmente devastato. Letto insieme alla mia amica Mon, è stato un viaggio delirante verso la devastazione dei miei personaggi preferiti. La Tahir ha creato una storia tra le mie preferite di sempre.
⠀
5) Stand by me di Bianca Marconero perchè abbiamo tutti bisogno di romanticismo, dolcezza e seconde possibilità nella vita. Dobbiamo credere che essa possa offrirci ciò che desideriamo nonostante gli ostacoli e che l'amore possa sorriderci senza tempo e senza misura.
⠀
